import React from 'react';
import Tilt from 'react-tilt';
import './Logo.css'

const Logo = () => {
	return (
		<div className='ma4 mt0'> 
			<Tilt className="Tilt br2 shadow-2" options={{ max : 25 }} style={{ height: 150, width: 150 }} >
	 		<div className="Tilt-inner"><span> <img src='https://www.google.ca/url?sa=i&source=images&cd=&cad=rja&uact=8&ved=2ahUKEwjVhKLk-7HeAhVKhOAKHZF-DHMQjRx6BAgBEAU&url=https%3A%2F%2Fen.wikipedia.org%2Fwiki%2FUniversity_of_Waterloo&psig=AOvVaw3_i1aHu4xpg_coHtSFlSq8&ust=1541119531505256'/> </span></div>
			</Tilt>

		</div>
	);

}

export default Logo;
